    render(){

        return(
            <div>
                 <form  method='post' encType="multipart/form-data" onSubmit={handleSubmit} > 
                    <div className="form-group">
                        <label  >Email </label>
                        <input type="email" name="email" className="form-control" onChange={handleChange} defaultValue={initialValue.email}/> 
                    </div>
                    <div className="form-group">
                        <label  >Password </label>
                        <input name="password" type="text" onChange={handleChange} className="form-control" defaultValue={initialValue.password} /> 
                    </div>
                    <div className="btn-group">
                        <button type="submit" className="btn btn-primary" onClick={()=>setTimeout(()=>{handleModal(false)},600 )}>Đăng nhập</button> 
                    </div>
                </form>
            </div>
        )
    }
}
export default withRouter(LoginPage);
